    false,nt"url": null,nt"notes": "This document contains five separate documents
    covering the work on Atlantic white-cedar between Alligator River NWR and the United
    States Air Force Dare County Bombing Range. The topics covered include the history
    and methods of restoration, an inventory of remnant stands in North Carolina, seed
    production and quality, and a discussion of linking ecosystem and refuge management
    with Atlantic white-cedar restoration. The titles of the five documents included
    in this report are as follows: Atlantic White-Cedar Ecosystem Restoration on Alligator
    River National Wildlife Refuge and United States Air Force Dare County Range, Restoration
    of an Atlantic White-Cedar Forest at Dare County Air Force Range, North Carolina,
    Inventory of remnant Atlantic white-cedar stands in North Carolina, Production and
    quality of Atlantic white-cedar seed in coastal North Carolina, Linking ecosystem
    management, refuge management and Atlantic white-cedar restoration",nt"license_title":
